import { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import PropTypes from "prop-types";
import { Card, Grid, Divider, Container, Typography, Box } from "@mui/material";

// Components
import MDBox from "components/MDBox";
import MDTypography from "components/MDTypography";
import TrimaIcon from "components/CustomIcons/Trima";

const ReportSection = ({ title, children }) => (
  <Box mb={3}>
    <MDTypography variant="h6" fontWeight="medium" mb={1}>
      {title}
    </MDTypography>
    <Box ml={2}>{children}</Box>
  </Box>
);

ReportSection.propTypes = {
  title: PropTypes.string.isRequired,
  children: PropTypes.node.isRequired,
};

const ReportField = ({ label, value }) => (
  <Grid item xs={12} sm={6} md={4}>
    <Box display="flex" flexDirection="column" mb={2}>
      <MDTypography variant="caption" color="text" fontWeight="bold">
        {label}
      </MDTypography>
      <MDTypography variant="body2">{value || "---"}</MDTypography>
    </Box>
  </Grid>
);

ReportField.propTypes = {
  label: PropTypes.string.isRequired,
  value: PropTypes.oneOfType([PropTypes.string, PropTypes.number, PropTypes.node]),
};

ReportField.defaultProps = {
  value: "---",
};

function TrimaReport() {
  const { codigo } = useParams();
  const [reportData, setReportData] = useState(null);

  useEffect(() => {
    const fetchReportData = async () => {
      try {
        const token = localStorage.getItem("authToken");
        const response = await fetch(
          `${process.env.REACT_APP_API_URL}/api/apheresisProcedures/${codigo}`,
          {
            headers: {
              Authorization: `Bearer ${token}`,
            },
          }
        );
        const data = await response.json();
        setReportData(data);
      } catch (error) {
        console.error("Erro ao buscar dados do relat√≥rio:", error);
      }
    };

    fetchReportData();
  }, [codigo]);

  if (!reportData) return null;

  return (
    <Container maxWidth="lg" sx={{ py: 4 }}>
      <Card>
        <MDBox p={3}>
          {/* Cabe√ßalho */}
          <Box display="flex" alignItems="center" mb={3}>
            <TrimaIcon sx={{ fontSize: 40, mr: 2 }} />
            <Box>
              <MDTypography variant="h4">Relat√≥rio de Procedimento Trima</MDTypography>
              <MDTypography variant="subtitle2" color="text">
                C√≥digo: {codigo}
              </MDTypography>
            </Box>
          </Box>

          <Divider sx={{ my: 3 }} />

          {/* Informa√ß√µes do Doador */}
          <ReportSection title="Informa√ß√µes do Doador">
            <Grid container spacing={2}>
              <ReportField label="Nome" value={reportData.nomeDoador} />
              <ReportField label="Data de Nascimento" value={reportData.dataNascimento} />
              <ReportField label="Tipo Sangu√≠neo" value={reportData.tipoSanguineo} />
              {/* Adicione mais campos conforme necess√°rio */}
            </Grid>
          </ReportSection>

          {/* Dados do Procedimento */}
          <ReportSection title="Dados do Procedimento">
            <Grid container spacing={2}>
              <ReportField label="Data" value={reportData.dataProcedimento} />
              <ReportField label="Hora In√≠cio" value={reportData.horaInicio} />
              <ReportField label="Dura√ß√£o" value={reportData.duracao} />
              {/* Adicione mais campos conforme necess√°rio */}
            </Grid>
          </ReportSection>

          {/* Resultados */}
          <ReportSection title="Resultados">
            <Grid container spacing={2}>
              <ReportField label="Volume Processado" value={reportData.volumeProcessado} />
              <ReportField label="Plaquetas Coletadas" value={reportData.plaquetasColetadas} />
              {/* Adicione mais campos conforme necess√°rio */}
            </Grid>
          </ReportSection>

          {/* Rodap√© */}
          <Box mt={4} pt={3} borderTop={1} borderColor="divider">
            <MDTypography variant="caption" color="text">
              Relat√≥rio gerado em {new Date().toLocaleString()}
            </MDTypography>
          </Box>
        </MDBox>
      </Card>
    </Container>
  );
}

export default TrimaReport;
